INSERT INTO `content_rating_system` (`crs_ID`, `crs_Symbol_Img`, `crs_Abbreviation`, `crs_Name`, `crs_Description`) VALUES
(1, , 'G', 'General', 'General <a href=\"https://en.wikipedia.org/wiki/Exhibition\">exhibition</a>, suitable for all ages but not necessarily intended for children. Content is VERY MILD in impact. G content may air at any time of day.'),
(2, , 'PG', '	Parental Guidance Recommended', 'Parental guidance is recommended for young viewers. Content is MILD in impact; Elements in these programs may require parental supervision for young children. PG content may air at any time of the day, on any network (as of 1 December 2015).'),
(3, , 'M', 'Mature', 'Recommended for viewing by persons aged 15 years or over. Content is MODERATE in impact; These programs may require a mature perspective and are deemed not suitable for all children. M content may only be broadcast between 7:30 p.m. and 6:00 a.m. on any day, and additionally between 12:00 p.m. and 3:00 p.m. on <a href=\"https://en.wiktionary.org/wiki/schooldays\">schooldays</a>.'),
(4, , 'MA15+', 'Mature Accompanied', 'Not suitable for people under 15. Content is STRONG in impact; It is advised people under the age of 15 do not view these programs, due to the strength of the elements within. MA15+ programming may only be broadcast between 8:30 p.m. and 6:00 a.m. on any given day. Consumer advice is mandatory.'),
(5, , 'AV15+', 'Mature Accompanied (Adult Violence) ', 'Not suitable for people under 15. Violence is STRONG in impact; this classification was the same as MA15+, except the \"AV\" stands for \"Adult Violence\". This category was used specifically for extremely violent programming. The AV classification was only allowed to exceed MA15+ content on the basis of violence, where MA15+ material could contain \"some violence\". AV15+ material could carry advisory warnings for \"frequent violence\" or \"strong violence\". AV15+ content may only be broadcast between 9:30 p.m. and 5:00 a.m. on any day. Consumer advice is mandatory.\r\nThe AV15+ classification was abolished after 30 November 2015. Strong impact violence is now incorporated into the MA15+ classification.');
